function SkuCore:bisLogin()
	SkuOptions.db.char[MODULE_NAME].bis = SkuOptions.db.char[MODULE_NAME].bis or {}
   SkuOptions.db.char[MODULE_NAME].bis.fiters = SkuOptions.db.char[MODULE_NAME].bis.fiters or {}
   SkuOptions.db.char[MODULE_NAME].bis.fiters.onlyPlayerClass = SkuOptions.db.char[MODULE_NAME].bis.fiters.onlyPlayerClass or L["On"]
   SkuOptions.db.char[MODULE_NAME].bis.fiters.phase = SkuOptions.db.char[MODULE_NAME].bis.fiters.phase or "T8"
   SkuCore:bisGetBisListData()
end

